import React from 'react';
import homem from '../../Assets/homem.jpg';
import styles from './Sobre.module.css';

const Sobre = () => {
  return (
    <section className={styles.contain}>
      <div>
        <img src={homem} className={styles.img} />
      </div>
    </section>
  )
}

export default Sobre;
